import{_ as t,c as o,o as n,ah as i}from"./chunks/framework.PvdZnrZd.js";const c=JSON.parse('{"title":"SBEEDY SHIPPING","description":"SBEEDY SHIPPING","frontmatter":{"title":"SBEEDY SHIPPING","description":"SBEEDY SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/sbeedy-shipping.md","filePath":"zenith/featured-app/shipping/sbeedy-shipping.md"}'),p={name:"zenith/featured-app/shipping/sbeedy-shipping.md"};function a(s,e,r,l,h,d){return n(),o("div",null,[...e[0]||(e[0]=[i('<p><a href="https://store.webkul.com/Shopify-Multi-Vendor-Marketplace.html" target="_blank" rel="noreferrer">Multi-Vendor Marketplace for Shopify</a> is here with another marketplace feature add-on, i.e., <strong>Sbeedy.</strong></p><p>This is now integrated with the <a href="/zenith/introduction/">Multi-vendor Marketplace App</a> for Shopify to let sellers fulfill their orders via the Sbeedy shipment service.</p><p>By enabling this feature app, the admin can allow sellers to manage the order fulfillment via Sbeedy shipping.</p><p><strong>Charges</strong>: This feature app costs you a minimal amount of <strong>$10 per month</strong> over and above your current Multivendor plan.</p><p>Note: Sbeedy shipping is used for both fulfillment and checkout.</p><h2 id="how-to-activate-sbeedy-shipping" tabindex="-1">How to activate Sbeedy Shipping ? <a class="header-anchor" href="#how-to-activate-sbeedy-shipping" aria-label="Permalink to &quot;How to activate Sbeedy Shipping ?&quot;">​</a></h2><p>To enable the featured app, all you need to do is to visit the “<strong>Feature Apps</strong>” section of the admin panel and enable it from there.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/10/feature-app.webp" alt="feature-app"></p><p>Once you click on “Feature Apps”, you will get the list of apps listed in this section. There, You will get the Sbeedy shipping feature. You just need to click the <strong>enable</strong> button.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/10/enable-2-1200x482.webp" alt="enable-sbeedy"></p><p>After enabling this you have to accept the charges and click on agree to enable the shipping on your store .</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/10/agree-1-1200x576.webp" alt="agree-sbeedy"></p><p>In this way, you can enable the feature within your Multivendor App.</p><h2 id="configuration" tabindex="-1">Configuration <a class="header-anchor" href="#configuration" aria-label="Permalink to &quot;Configuration&quot;">​</a></h2><p><strong>ADMIN END</strong><br> Once you enable this feature app, a new sub-menu gets added in the Configuration menu of the app i.e. Admin Sbeedy Configuration.</p><p>Before this, You need to visit Configuration&gt;&gt;Shipping Methods and enable <strong>Sbeedy Shipping</strong> as shown in the below screenshot:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/10/enable-shipping-1200x475.webp" alt="enable-sbeedy "></p><p>Once enabled, navigate to the <strong>Configuration</strong> menu, scroll down, and go to <strong>Admin Sbeedy Configuration</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/10/admin-sbeedy-1200x552.webp" alt="admin-sbeedy"></p><p>After this, you will be redirected to the <strong>Sbeedy Shipping Configuration</strong> page, where you need to enter the <strong>Sbeedy API key</strong>.</p><p>We also offer a <strong>test mode</strong> if you’d like to test before applying it to your store. For development purposes, please turn off test mode.</p><p><strong>SHIPPING LABEL COST BEARED BY</strong>: The admin needs to select who will bear the shipping label cost from the dropdown menu, either the admin or the seller.</p><p>These charges are separate from what the customer has paid.</p><p><strong>Set Shipping Rate</strong>: The shipping rate entered will be displayed to the customer on the checkout page only if the rate is not available from the Sbeedy API.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/11/sbeedy1.webp" alt="image"></p><h3 id="seller-panel" tabindex="-1">Seller Panel <a class="header-anchor" href="#seller-panel" aria-label="Permalink to &quot;Seller Panel&quot;">​</a></h3><p>Once you configure these details, the sellers will also get the option to enable the Sbeedy shipping from the <strong>Shipping</strong> <strong>method</strong> menu of their seller panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/11/sbeedy2.webp" alt="image"></p><h2 id="select-sbeedy-shipping-for-the-product" tabindex="-1">Select Sbeedy shipping for the product. <a class="header-anchor" href="#select-sbeedy-shipping-for-the-product" aria-label="Permalink to &quot;Select Sbeedy shipping for the product.&quot;">​</a></h2><p>To select Sbeedy shipping, both the admin and the seller can do so when adding or editing a product.</p><p>At the time of adding or editing the product, the admin or seller can select <strong>Sbeedy</strong> shipping from the <strong>Shipping Details</strong> section and choose <strong>Sbeedy</strong> as the shipping method.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/11/sbeedy3-1200x463.webp" alt="image"></p><p>If the customer selects Sbeedy shipping for the product, the checkout page will display the Sbeedy shipping cost.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/11/sbeedy4-1200x545.webp" alt="image"></p><h2 id="how-to-fulfill-orders-using-sbeedy-shipping" tabindex="-1">How to fulfill orders using sbeedy shipping ? <a class="header-anchor" href="#how-to-fulfill-orders-using-sbeedy-shipping" aria-label="Permalink to &quot;How to fulfill orders using sbeedy shipping ?&quot;">​</a></h2><p>To fulfill orders using <strong>Sbeedy Shipping</strong> on the seller&#39;s end, select <strong>Sbeedy Shipping</strong> as the fulfillment method while processing the order.</p><p>Then, enter the <strong>pickup and delivery date and time</strong> as shown in the image below, and simply click <strong>Agree and Fulfill</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/11/sbeedy5-1200x433.webp" alt="image"></p><p>After this, you will receive the tracking number for the product, along with the delivery and pickup date and time that you had entered previously.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/11/sbeedy6-1200x518.webp" alt="image"></p>',40)])])}const u=t(p,[["render",a]]);export{c as __pageData,u as default};
